description:
Amulet of Time: Shadow of la Rochelle - Wendy99


Genre: Hidden Object | Puzzle


When the ghost of the beautiful Diane de Poitiers appears in front of you, you are transported back in time in Amulet of Time: Shadow of la Rochelle! Explore France 
and an incredible love story in this amazing Hidden Object Puzzle Adventure game. Uncover a conspiracy against the king's mistress and protect her to return to the present. Live through an incredible tale in Amulet of Time: Shadow of la Rochelle!


Explore beautiful France
Protect the king's mistress
Change the past to return home!


System Requirements:


OS: Windows XP | Windows Vista | Windows 7
CPU: 1.0 GHz
RAM: 1024 MB
DirectX: 8.0
Hard Drive: 572 MB


Install and play


